import React from 'react';
import firebase from '../utils/firebaseConfig';
import {NavLink} from "react-router-dom";

const Nav = () => {
  return (
    <div className="Nav">
     <NavLink exact to='/SignUp' activeClassName="nav-active">Connexion</NavLink>
     <NavLink exact to='/ef' activeClassName="nav-active">dfed</NavLink>
    </div>
  );
};

export default Nav;
